import "./Components.css";

export default function Header() {
  return (
    <div class="header">
      <h1 class="titulo1">¡Pizzería Mamma Mia!</h1>
      <h2 class="titulo2">¡Tenemos las mejores pizzas!</h2>
    </div>
  );
}
